import Liability from "./Liability";

const Liabilities = ({
  short_term,
  long_term_debt,
  is_editing,
  formatToCurrency,
  toggleEditing,
  currency,
  currency_codes,
  updateInputValue
}) => {
  return (
    <table className="table">
      <tbody>
        <tr>
          <th>Short Term Liabilities</th>
          <th>Monthly Payment</th>
          <th></th>
        </tr>
        {Object.entries(short_term).map(([key, value]) => (
          <Liability
            liability={value}
            key={value.id}
            is_editing={is_editing}
            formatToCurrency={formatToCurrency}
            toggleEditing={toggleEditing}
            currency={currency}
            currency_codes={currency_codes}
            updateInputValue={updateInputValue}
          />
        ))}
        <tr>
          <th>Long Term Debt</th>
          <th></th>
          <th></th>
        </tr>
        {Object.entries(long_term_debt).map(([key, value]) => (
          <Liability
            liability={value}
            key={value.id}
            is_editing={is_editing}
            formatToCurrency={formatToCurrency}
            toggleEditing={toggleEditing}
            currency={currency}
            currency_codes={currency_codes}
            updateInputValue={updateInputValue}
          />
        ))}
      </tbody>
    </table>
  );
};

export default Liabilities;
